import List from '@mui/material/List';
import React, { Fragment, useState } from 'react';
import PropBetListItem from './PropBetListItem';

const items = [
    { id : 1, name : "Nathan Riviere", type: "passingYards", line: 255.5, over: 100, under: -150, overPct: 72, underPct: 28 },
    { id : 2, name : "Nathan Riviere", type: "passingYards", line: 255.5, over: 100, under: -150, overPct: 72, underPct: 28 },
    { id : 3, name : "Nathan Riviere", type: "passingYards", line: 255.5, over: 100, under: -150, overPct: 72, underPct: 28 },
    { id : 4, name : "Nathan Riviere", type: "passingYards", line: 255.5, over: 100, under: -150, overPct: 72, underPct: 28 },
    { id : 5, name : "Nathan Riviere", type: "passingYards", line: 255.5, over: 100, under: -150, overPct: 72, underPct: 28 },
    { id : 6, name : "Nathan Riviere", type: "passingYards", line: 255.5, over: 100, under: -150, overPct: 72, underPct: 28 },
    { id : 7, name : "Nathan Riviere", type: "passingYards", line: 255.5, over: 100, under: -150, overPct: 72, underPct: 28 },
    { id : 8, name : "Nathan Riviere", type: "passingYards", line: 255.5, over: 100, under: -150, overPct: 72, underPct: 28 },
    { id : 9, name : "Nathan Riviere", type: "passingYards", line: 255.5, over: 100, under: -150, overPct: 72, underPct: 28 },
    { id : 10, name : "Nathan Riviere", type: "passingYards", line: 255.5, over: 100, under: -150, overPct: 72, underPct: 28 }
]

interface Props {
    id : number;
}


const BetList: React.FC<Props> = (props) => {
    let id = 0;
        return (
            <List>
                {items.map((item) => (
                    <PropBetListItem id={id++} name={item.name} type={item.type} line={item.line} over={item.over} under={item.under} overPct={item.overPct} underPct={item.underPct} ></PropBetListItem>
                ))};
            </List>
        );
}

export default BetList;
